import React  from 'react';     
// styles
import './cardView.scss'; 

interface CardViewProps { 
  imageCard:string;
  nameCard:string;
  className?:string;
 }  



export const CardView: React.FC<CardViewProps> = ({  imageCard, nameCard, className }) => {   

  const classList =  'cardView ' + className  

  return (
    <div className='pg-cardView'>   
      <img className={classList} src={'./image/'+imageCard} alt={nameCard} />
    </div>
  );
};
